History Documentary hosted by Stanley Bernard, published by History Channel in 2001 - English narration


Information
------------------------------

Gods and Goddesses 
The world of the Ancient Greeks lives on today through its mythology. For countless generations prior to biblical times, tales of gods and goddesses were passed down by storytellers and interwoven into traditions and philosophies. Each city devoted itself to particular gods. But these gods also had human frailties. Where did the pantheon originate? Did any of the stories in Greek mythology actually occur? We look at new archaeological evidence that supports the possibility.
This History Channel program delves deep into the stories of the Greek Olympian pantheon. History Channel Presents Gods and Goddesses video In addition to thoroughly exploring the myths and traditions, Gods and Goddesses visits archeological sites, interviews experts, and speculates on the relevancy and continually changing perspective on the Greek myths.

